import Link from 'next/link';
import styled from 'styled-components';

const ATag = styled.a`
    text-transform: uppercase;
    text-decoration: none;
    margin-right: 60px;
    color: #323232;
    font-weight: 700;
    cursor: pointer;
    &:hover {
        color: #1a1a1a;
    }
`;
const HeaderContainer = styled.header`
    padding: 0px;
`;

const Header = () => (
    <HeaderContainer>
        <Link href="/" passHref>
            <ATag>Home</ATag>
        </Link>
        <Link href="/schedules" passHref>
            <ATag>Schedules</ATag>
        </Link>
        <Link href="/about" passHref>
            <ATag>About</ATag>
        </Link>
    </HeaderContainer>
);
export default Header;
